Description:
We are looking for individuals with a proven track record in big data projects. A background in AML, KYC, screening, regulatory compliance or fraud is highly advantageous, especially for more senior roles.
In this role you will:
Work with clients to solve business problems in the area of fraud, compliance and financial crime:
Manage, transform and cleanse high volume data;
Write defensive, fault tolerant and efficient code for data processing;
Automate data processing to enable on-going alerts on high risk activity;
Present project results to clients.
Work very closely with data scientists to ensure efficient and effective delivery of solutions;
Use leading open source big-data tools, such as Spark, Hadoop, Scala and Elasticsearch. You should be comfortable with working with high profile clients, on their sites;
Work with our expert software development team to produce reusable applications:
Use emerging and open source technologies such as Spark, Hadoop, and Scala;
Collaborate on scalability issues involving access to massive amounts of data and information;
Take on ad-hoc tasks as required for the running of a small, yet rapidly expanding business.

For senior roles in addition you should be comfortable:
Working with clients to Elicit and document solution requirements;
Assuring high quality implementation of solutions;
Providing technical vision for, managing and developing teams to deliver Quantexa’s software to clients.
Requirements
Candidates must have the following:
Proven big data experience, either from an implementation or a data science prospective;
Excellent technical skills including expert knowledge of at least one big data technology such as Spark, Hadoop, or Elasticsearch;
Experience of building data processing pipelines for use in production “hands off” batch systems, including either (or preferably both) traditional ETL pipelines and/or analytics pipelines;
Strong coding experience in the likes of Scala, Java or Python;
Strong client facing, communication and presentation skills;
Strong academic qualifications, high quality degree (2:1 or above) or equivalent;
Enthusiasm to learn and develop emerging technologies and techniques;
Exhibit strong technical communication skills with demonstrable experience of working in rapidly changing client environments;
Demonstrate strong analytical and problem-solving skills and the ability to debug and solve technical challenges with sometimes unfamiliar technologies;
For senior roles: be comfortable with principles behind data science to build processing pipelines supporting analytical users (direct data science experience itself is not a pre-requisite but is desirable).

Ideal candidates will also:
have worked on a variety of complex data orientated projects for financial services clients;
have a good understanding of Computer Science and preferable come from a software engineering background or other scientific degree incorporating IT modules (e.g. Maths/Physics);
have exposure to Agile, especially SCRUM;
be open to short-medium term international travel;
Arrive with experience at working with a variety of modern development tooling (e.g. Git, Gradle, Jenkins, Nexus) as well as technologies supporting automation and DevOps (e.g. Ansible, Chef, Puppet, Docker and a little bit of good old Bash scripting);
Have an excellent appreciation of what makes a high quality, operationally stable system and how to streamline all areas of development, release and operations to achieve this.
Benefits
We’re looking for high performing individuals and offer competitive base salary commensurate with experience plus bonus, commission and generous benefits.

SALARY:
up to $180k package including Bonus

ABOUT THE COMPANY:
Our client is an ASX Listed FMCG giant. With local revenues in excess of $5+ billion, they are recognised as one of the world's largest players in their sector. With an international portfolio of products, they are envied for their quality and reputation. Due to a large business transformation, this role has been created for a Senior Business Intelligence Consultant.

ABOUT THE ROLE:
This is an exciting opportunity to join a high performing team, where you will be instrumental in driving the business through its next phase of transformational change. As a Senior Business Intelligence Consultant, you will be involved in all phases of the software development life cycle, collecting and documenting business requirements, prototyping solutions, development, deployment and ongoing improvement.

KEY RESPONSIBILITIES:
Reporting to a seasoned and inspirational Head of Business Intelligence & Analytics, your key responsibilities will include:
Act as senior liaison between all potential business areas that may use business intelligence tools;
Develop analytical & reporting tools, promote and drive adoption of developed BI solutions;
Influence and maintain BI strategy and solutions;
Demonstrate and promote data-driven decision making culture at all levels;
Develop information architecture;
Actively participate in the business BI community;
Establish and enforce technical standards and documentation;
Coach and mentor other BI developers and data analysts.
SKILLS AND EXPERIENCE:
You ideally have at least 5-10 year's experience in a similar business intelligence development position, with an extended prior background in software development. You possess a proven track record of leading and delivering large and successful projects. To be successful in the role you will require a high level of expertise across all facets of the Microsoft BI stack and prior experience of designing/ developing robust data warehouse solutions. You will have in-depth knowledge of Tabular modelling and DAX, OLAP cube development using Microsoft SSAS and MDX, SSIS and experience with Azure cloud platform.

In addition, you will have:
Bachelor Degree in Computer Science, Software Engineering or equivalent;
Demonstrated experience in a hands on data-warehousing/business intelligence development role;
Demonstrated experience using development tools in Microsoft BI range such as Visual Studio, SQL Server and TFS;
Demonstrated experience in developing reporting and analytical tools using MS BI toolset such as PowerBI, Analysis Services and Reporting Services;
Knowledge of full SDLC and Agile methodologies;
Experience with predictive analysis models and R, Python;
Ability to mentor and train members of analyst community;
Analytical ability to organise and query data;
Self-motivated and enthusiastic approach to work;
Able to work autonomously or as a leader/member of a team;
Hunger for continuous improvement and self-education;
A forward planning/strategic work outlook;
Able to improvise, adapt and overcome objections/resistance and achieving goals;
Excellent written and oral communication skills;
Inquisitive nature, ability to challenge status quo.
CULTURE AND BENEFITS:
Driven by deep core operating values, this organisation is a true success story. Passionate about culture, diversity and people, this organisation leads the way. This is an outstanding opportunity within a highly visible part of the business, dealing with a breadth of senior stakeholders and would suit a proactive, driven and passionate individual that enjoys providing insightful input into the future direction of the organisation. If you are looking to take your career to the next level, this one is hard to beat.

APPLY:
If this sounds like you, please send your resume in word format by clicking the “apply now” link below.

FOLLOW US:
Follow Recode Group on LinkedIn at https://www.linkedin.com/company/recodegroup/ and visit www.recodegroup.com.au for further information and for other interesting job opportunities.

About the team and agile working…
The rapid pace of technology shifts and disrupts as well as increasing competition in the telco space means we need to work differently to anticipate what our customers want and stay ahead of our competitors. The Agile approach brings people together from different functions to work as one team. Being co-located and guided by a specific purpose, these cross-functional teams can drive collaboration across our different business divisions. The SMB (Small & Medium Business) Loyalty & Customer Value cross-functional team is being established to support our SMB business unity to maximising the lifetime value of every Optus SMB customer. The team will focus on delivering the business with a clear view and insights on the SMB base, build predictive models for churn and base growth and executing on campaigns to drive incremental uplift in base growth and customer retention.

About the role…
The Data Analyst within the SMB Loyalty & Customer Value team is a critical role to help realise the vision of becoming a customer-centric, digital telco, driven by a data and advanced analytics capability that delivers exceptional and cost effective employee and customer experiences and optimises customer and household revenue growth.

As a senior technical specialist within a cross-organisational team, with the rare combination of both SQL and Tableau expertise the Data Analyst will be required to mentor stakeholders within the Loyalty & Customer Value Management, Data Centre of Excellence, Digital Marketing & Customer Engagement and frontline teams in order to enable best-practice use and understanding of our data insights and analytics self-service capabilities (Tableau) to fast-track our ability to grow revenue, increase scale and automation, reduce costs and improve customer experience. The ideal candidate for this role must be analytical, a good problem solver with an advanced knowledge of SQL and Tableau. Good intrapersonal skills and ability to work autonomously are also crucial to support cross functional engagement and decision making alongside peers. The Data Analyst will be a strong contributor to the analytics strategy, capability and delivery of insight and analytics programs of work required to support the SMB business to make better business decisions and to create more profitable and personalised products, offers, content, communications, sales and service experiences delivered at the right time, in the right channel, communicated in the right way, in the right context, to the right target customers and prospective customers… And with real time data on customer behaviours and business results!

Responsibilities will include:
Querying customer data, performing analyses, and presenting findings in a clear and understandable language to cross functional team and stakeholders and drive adoption/understanding of these findings;
Translating complex business questions into analytical tasks;
Performing data, statistical and commercial analysis to understand how customer behaviour, product changes and market dynamics impact the SMB business;
Consolidating information from across the Insights team to present a holistic view of customer behaviour and market trends including Research, Data Science, Commercial, External Market Analysis and Marketing effectiveness;
Developing recommendations with a clearly articulated, structured argument;
Delivering findings back to stakeholders to drive well-informed decision-making;
To interpret the insights, we would require the data analyst to complex reports and dashboards which could entail building attrition curves, survival /decay curves, radial charts, area charts, surface charts, bubble charts which would help drive actions.
Basic understanding of statistical techniques to provide meaningful base and campaign insights.

The Data Analyst will be engaging and collaborating with their key Business Unit/s stakeholders to understand the key business problems to be solved and the key business metrics they need to impact through business analysis and intelligence, supporting the translation of requirements into analytical tasks. The effective interpretation of business trends, customer behaviours and market dynamics are critical to the success of the company. In order to make these recommendations, the Data Analyst must be proficient in variety of analytical techniques including data, statistical and commercial analysis as well as be comfortable with research and unstructured datasets. The Data Analyst must be able to work with a number of stakeholders through the end-to-end business analysis process from requirements gathering to problem articulation and delivering recommendations back to the business. Above all, deliverables must demonstrate a structured approach, analysis and recommendations. The Data Analyst must ensure accuracy and completeness in the customer and performance data required to adequately support analytics and business intelligence for the BU portfolio they own. are any requirements will shared with their team and briefed into the Data Development & Visualisation team and any business problems that are better solved through collaboration with the Data Science or Research teams are briefed into and followed through in collaboration with those teams.

Optus believes in the strength of a vibrant, diverse and inclusive workforce where backgrounds, perspectives and life experiences of our people help us innovate and create strong connections with our customers.

Heads Up!
Due to the fast paced nature of our business, vacancy close dates may change, so make sure you apply today!

