Work for a global organisation

Copious amounts of opportunities for career progression

About Our Client
My Client is a global powerhouse and if deemed successful you'll be working for one of the greatest names in the industry. Want to develop a career internationally and never hit a ceiling when it comes to career progression? Apply today!!

Job Description
Collecting, analysing and maintaining customer data across my clients business and its marketing channels;
Generate insight into customer segments for use within business development and other CRM initiatives;
Provide data metrics to both internal and external stakeholders;
Use SQL server and excel to prepare accurate marketing campaign lists and report;
Manage end-to-end campaign execution process from liaising with Design team, content team and business to creating campaign on exact target to prepare an eDM list;
Manage CRM lifecycle EDM series to ensure candidates and clients are fully engaged at the right time with the right communication;
Liaise with internal and external stakeholders to achieve set objectives and tasks.
The Successful Applicant
Minimum 5 years of experience working closely with data/reporting in a SQL server environment or CRM;
Experience reporting to senior stakeholders preferred;
Background in PowerBi, Exact target, salesforce marketing cloud, Pardot/Marketo and SQL is required;
Identifying best practice and reporting function methodologies;
Embrace and initiate change;
Experience working with teams and stakeholders across multiple geographies and business lines will be highly regarded;
Hands on experience such as SQL data extraction, running campaigns, driving projects.
What's on Offer
Work globally
Competitive salary
Dynamic Working
Contact:
Madeleine Shelest

CT’s mission is to give people the power to utilise technology in a meaningful way that helps them accomplish their goals. Through our family of products and services, we're building a different kind of company that is obsessed by the continual improvement of the customer experience, removing friction experienced by our customers every day. Whether we’re creating new tools or helping a small business be more efficient, the people at CT are problem solvers at heart. Our nationwide teams are constantly iterating, solving problems and working together to empower people throughout Australia to utilise technology in meaningful ways that help them to achieve their goals.

 As a fast-growing start-up with just over 10 years’ experience and only 1% of the way through completing our mission, we are a team that utilises our curiosity to challenge the norms and focus our energy on solving problems we see as being something that just shouldn’t exist. We are hardworking and relentlessly committed to our mission but with that comes an environment that represents a place we are truly proud to work. This includes an in-house beer tap, a pantry stocked with treats, café style coffee and regular social events. Our organisations culture is one of our biggest assets with transparency being one of our most core values fostered by all levels of our leadership. We run fortnightly Town Halls where our team members can ask and receive live answers to unfiltered questions about any topic by our Managing Director.

Career progression is an important part of team member satisfaction and as such we foster a culture of continuous learning and improvement. Our team members are provided the ability to progress their careers as an Individual Contributor working up the ladder of technical capability in their chosen area as well as a pathway for People Managers. As we continue to focus on achieving our mission, our teams will naturally continue to expand, and we are honoured by our growth of more than 30% year on year to date – but we are just getting started!

We have an exciting opportunity for a Reporting Analyst (Data Analyst) to join our growing team. The ideal candidate will be a passionate person who is eager to learn and challenge themselves to continuously iterate our internal and external reporting functions to be the very best they possibly can be.The successful candidate will work within our existing Data Analysts and will take on the focus of our reporting functions for customers as well as internal and external stakeholders. Our reporting functions utilise SQL Server Reporting Services (SSRS) and Microsoft PowerBI and so some exposure to these platforms will be beneficial. As part of the candidates day to day role, they will be responsible for reviewing our existing reporting functions, templates and working to continuously refine these, adding meaningful data, metrics and gauges to these reports to increase the consumption of these reports whilst making them easy to understand.

The quality of the data stored within our Warehouses and Data Lakes is fundamental to producing quality reports and as such, the continuous cleansing and validation of data is an important part of this role. It is imperative to our business that the reports we produce are not only accurate but also meaningful, timely and represent a high standard of quality to reflect our business values.

Through the consumption of the reports produced, our team members and customers are able to make better decisions and for this reason, we are committed to ensuring our reporting functions are the very best they can be.

Responsibilities:
Manage our SSRS Reporting Templates with a goal of continuously improving these with additional data and metrics;
Utilise your understanding of our business (over time) to predict what data would be useful for various teams and customers and include these in the reports produced;
Manage the monthly reporting cycles for customers to ensure all reports are automatically and correctly generated by the system and that the reports meet our standards in terms of data quality and accuracy;
Manage the data sources, reviewing the accuracy of the data contained within them and ensure you drive the message of quality data throughout the organisation;
Cleanse the data contained in our data warehouses and data lakes to ensure that the quality of our data is high;
Seek and develop additional data streams to capture and warehouse for future reporting and analysis;
Over time, learn and manage the PowerBI reporting functionalities which we utilise for dash boarding;
Actively improve our processes and procedures and develop new ones for any process that doesn't exist;
Qualifications, Skills & Experience

Have a passion for data quality and analysis;
Have skills and experience in managing Microsoft SSRS Reports;
Demonstrate a commitment to high quality through relentless attention to detail;
Be able to understand the data you are reporting on and have a hypothesis as to the value you believe it will bring to our organisation or customer;
Have excellent verbal and written communication skills in English;
The ability to multi-task and be resourceful in solving issues with competing priorities

Locality:
As a result orientated company, your performance will be measured on the outcomes achieved in this role. This role is based at our Coburg headquarters and there is an expectation that the team member will be onsite of at least between the hours of 8.30am and 5pm Monday to Friday;
 Other Requirements

All our team members are expected to obtain and maintain a valid Victorian Working with Children Check;


Note to Recruitment Agencies:
We do not accept unsolicited emails or phone calls from recruitment agencies at any stage.

